% % run the clear-sky detection routine.
% csd = Polo2009(ghi,ghics,zen,1); %plot figure set to 1 so an output is plotted
%
function csd = Polo2009CSD(ghi,ghics,zen,plot_figure)
% safety checks
if ~iscolumn(ghi)
    ghi = ghi';
    if ~iscolumn(ghi)
        error('var ghi must be a column vector')
    end
end
if ~iscolumn(ghics)
    ghics = ghics';
    if ~iscolumn(ghics)
        error('var ghics must be a column vector')
    end
end
if ~iscolumn(zen)
    zen = zen';
    if ~iscolumn(zen)
        error('var zen must be a column vector')
    end
end
if length(unique([length(ghi),length(ghics),length(zen)]))~=1
    error('vars must be equal in length')
end

% need to isolate the data from a whole day, even for non-continuous data.
% the simplest and most effective method is to estimate the local solar
% noon, this removes a need for other metadata and relies soley on zenith
% rate changes.
% find the difference in horizontal extraterrestrial irradiance, note that
% at solar noon, the rate of change is positive in the morning, negative in
% the evening, at some point the rate must cross 0 at solar noon.
ext_rate_of_change = [NaN;diff(1365.*cosd(zen))];
% find the minutes at suspected solar noon, take an abs to ignore the
% afternoon, the shape is like a curved V shape, note that zeniths >~90deg
% must be screened as Eext is 0 at night.
idxs = find(abs(ext_rate_of_change)<0.05);
% there are likely to be many periods of rate being <0.05 as it is a
% conservative measure, it allows the exact solar noon to be absent from
% the study. Many cases of <0.05 are indexed consecutively, e.g. idx=1
% minute differences, and so we can remove any diff that is consecutive.
delta_idxs = [0;diff(idxs)];
% remove any case where the rate change is 1, leaving only a single solar
% noon per "day".
idxs(delta_idxs==1)=[];
% build the indices for ghi data
x = (1:length(ghi))';
% using a k-nearest neighbours seach algorithm, we can find where the
% nearest solar noon index is to every index in our data.
nearest_noon = knnsearch(idxs,x);
% by taking a unique of these nearest neighbours, we have a perfect list of
% days without the need of time vectors or DOY values.
unique_days = unique(nearest_noon);

csd = ones(size(ghi)); % 1 = cloud
for i = 1:length(unique_days)
    % find data points of current day
    ind = find(nearest_noon==unique_days(i));
    
    % Determinant of correlation matrix
    determinant = det(corrcoef(ghi(ind),ghics(ind)));
    
    % only consider day clear if missing <80% of data points and det<0.005
    if length(ind) > 0.2*24*60 && determinant < 0.005
        % is clear
        csd(ind)=0;
    end
end

%% figure example
if exist('plot_figure','var')
    figure('name','Polo CSD example','color','w');
    hold on
    plot(ghi)
    CSD = ghi;
    CSD(csd==1)=NaN;
    plot(CSD,'linewidth',2,'color','k')
    hold off    
    legend('GHI','Clear detected')
    ylabel('Irradiance [Wm^{-2}]')  
    set(gca,'xtick',[]);
    xlabel('Time')
end



